import React from "react";

const Add = () => {


    return (
        <div>
            <h1>Add</h1>
            <div className="books">
                {books.map(book=>(
                    <div className="book" key={book.id}>
                        {book.cover && <img src={book.cover} alt="" />}
                        <h2>{book.title}</h2>
                        <p>{book.desc}</p>
                        <span>{book.price}</span>
                    </div>
                ))}
            </div>
            <button><Link to="/add">Add new book</Link></button>
        </div>
    )
}

export default Books;
